    function getMyMessages(address userA, address userB) external view returns (Message[] memory) {
        uint count = 0;

        for (uint i = 0; i < messages.length; i++) {
            if (
                (messages[i].sender == userA && messages[i].receiver == userB) ||
                (messages[i].sender == userB && messages[i].receiver == userA)
            ) {
                count++;
            }
        }

        Message[] memory result = new Message[](count);
        uint index = 0;

        for (uint i = 0; i < messages.length; i++) {
            if (
                (messages[i].sender == userA && messages[i].receiver == userB) ||
                (messages[i].sender == userB && messages[i].receiver == userA)
            ) {
                result[index] = messages[i];
                index++;
            }
        }

        return result;
    }

